import React from 'react';

function Winners(props) {
    let winningTeam = '';
    let winningPlayers = '';
    let newGame = '';
    if(props.gameOver) {
        winningTeam = props.teamWinners + ' Win!'
        winningPlayers = 'Winners: ' + props.playerWinners
        if(props.isHost) {
            newGame = <button className='party-button' onClick={props.startGame}>New Game</button>
        }
    }
    
    return (
        <div>
            {winningTeam}
            {winningPlayers}
            {newGame}
        </div>
    );
}

export default Winners;
